import React from 'react'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

function DisplayStatistic({data}) {
    let hasData=false
    let tmp;
    if(data!=="No Data")
    {
        tmp = JSON.parse(data)
        hasData=true
    }
  return (
    <Row>
        <Col>
        <p>{hasData ? "": "No Data"}</p>
        {hasData && 
            <>
            <b>Continent: </b> {tmp.continent} <br/>
            <b>Country: </b> {tmp.country} <br/>
            <b>Population: </b> {tmp.population} <br/>
            <b>New Cases: </b> {tmp.cases.newCases} <br/>
            <b> Cases: </b> {tmp.cases.newCases} <br/>
            </>


        }

        </Col>

    </Row>
  )
}

export default DisplayStatistic
